import "./NavBar.scss";

const NavBar = () => {
  return (
    <nav className="nav">
      <ul>
        <li>Home</li>
        <li>About</li>
        <li>Work</li>
        <li>Contact</li>
      </ul>
    </nav>
  );
};

export default NavBar;
